import "../css/nopage.css"

class NoPage extends Component {
  render (){
    const myStyle={
      backgroundImage: "url('https://media.geeksforgeeks.org/wp-content/uploads/rk.png')",
      height:'100vh',
      marginTop:'-70px',
      fontSize:'50px',
      backgroundSize: 'cover',
      backgroundRepeat: 'no-repeat',
    };

    return (
      <div class="h-100 d-flex align-items-center justify-content-center">
        
        <h1 id="nopage__header1">Far out!</h1>
        <h2 id="nopage__header2">We're not sure how you got here...</h2>
        <h2>But you may be lost in cyberspace</h2>
        
        <button class="404__button">Return Home</button>
    </div>
    )
  };
}
  
  export default NoPage;
